import React from "react";

const Inputs = (props) => {

	return (
		<div>
			<p>Texto del input</p>
			<label htmlFor={props.id}></label>
			<input type="checkbox" disabled={props.disabled}/>
			<input className={props.clName} type="text" id={props.id} name={props.name}/>

		</div>
	);
};

export default Inputs;
